import 'bootstrap/dist/css/bootstrap.css';
import React from 'react';
import NavBar from './NavBar';
import MainContent from './MainContent';
import SearchSong from './SearchSong';
import Profile from './Profile';
import Footer from './Footer';
import App from '../src/App';
import 'bootstrap/dist/css/bootstrap.css';
import { useState } from 'react';


function Home() {


  return (
    <div className="App">
      <NavBar />
      <MainContent songObjects={App.songObjects} setSongObjects={App.setSongObjects}/>
      <SearchSong songObjects={App.songObjects} setSongObjects={App.setSongObjects} songList={songList} setSongList={setSongList} listInput={listInput} setListInput={setListInput}/>
      <Profile songList={App.songList} setSongList={setSongList}/>
      <Footer />

    </div>
  );
}


export default Home;
